import React, { Component } from "react";

import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {};
  }
  render() {
    return (
      <div className="App">
        <h1>StopWatch</h1>
        <div className="screen" />
      </div>
    );
  }
}

export default App;
